import React from 'react';
import ReactTable from 'react-table-6';
import 'react-table-6/react-table.css'
//import "./componentsStyles.css"


const DataTable = ({ columns, data}) => (
  <ReactTable
  data={data}
  columns={columns}
  defaultPageSize={10}
  width="50"
  />
);

export default DataTable;
